import React, {useState, useEffect} from 'react';
import Logo from './Logo'
import AnimeSearchPage from '../AnimeSearchPage';

const Navbar = () => {


  const [pageNum, setPageNum] = useState(1);
  const [reviewList, setReviewList] = useState([<AnimeSearchPage key={1} pageNum={1}/>])


  
  return (
    <div className='navbar'>
        <Logo/>
        <div className="navbar-search-container">
          <input type="text" className="navbar-search" placeholder="Search for an anime..."/>
          <button className="navbar-search-btn" type="submit">
            <i className="fas fa-search"></i>

          </button>
        </div>

    </div>
  )
}

export default Navbar
